import { useState } from "react";

const Postingblogs = ({ user }) => {
  const [author, setAuthor] = useState("");
  const [title, setTitle] = useState("");
  const [url, setUrl] = useState("");

  const submitNewBlog = async () => {
    const newBlog = {
      title: title,
      author: author,
      url: url,
      user: user,
    };
  };

  return (
    <div>
      <div>
        <h1>Add new blog</h1>
        <label>Title: </label>
        <input
          value={title}
          type="text"
          placeholder="Title of blog"
          onChange={(e) => setTitle(e.target.value)}
        ></input>
      </div>
      <div>
        <label>Author: </label>
        <input
          value={author}
          type="text"
          placeholder="Author of blog"
          onChange={(e) => setAuthor(e.target.value)}
        ></input>
      </div>
      <div>
        <label>URL: </label>
        <input
          value={url}
          type="url"
          placeholder="URL of blog"
          onChange={(e) => setUrl(e.target.value)}
        ></input>
      </div>
    </div>
  );
};

export default Postingblogs;
